int getChar(char *ler, char input){
    for(int i = 0; i < SIGMA; i++){
        if(ler[i] == input){
            return i;
        }
    }
    return -1;
}

bool ehFinal(int *final, int atual){
    for(int i = 0; i < QNT_FINAIS; i++){
        if(final[i] == atual){
            return true;
        }
    }
    return false;
}

void resetarEstados(int *indice, int definirIndice, int *backupIndice, int *fim, int *estadoAtual){
    *indice = definirIndice;
    *backupIndice = *indice;
    *fim = -1;
    *estadoAtual = 1;
}

void imprimirErroLexico(void *cadeia, char *input, int linha, int coluna, bool *textoAntes, bool *flagLexico, char *tokenConteudo){
    if(*flagLexico){
        return;
    }

    if(input[coluna] == 10 || input[coluna] == 32){
        return;
    }

    if(*textoAntes){
        printf("\n");
    }
    printf("ERRO LEXICO. Linha: %d Coluna: %d -> '%c'", linha, coluna + 1, input[coluna]);
    freeLista(cadeia);
    free(input);
    free(tokenConteudo);
    *textoAntes = true;
    *flagLexico = true;
    exit(-1);
}